import React from 'react';

const Searchbox = ({searchfield, SearchChange}) => {
	return (
		<div>
			<input  className=""
					type="search"
					placeholder="search robots"
					className="bg-lightest-blue br1 w-100 ma2 mr-4 b--green pa2" 
					onChange={SearchChange}
					/>
		</div>
	);
}

export default Searchbox;
